import './Home.css'
import marela from '../Assets/marela.jpeg';
import title from '../Assets/name.svg'
import NavMenu from '../NavMenu/NavMenu';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import DescriptionIcon from '@mui/icons-material/Description';
import { Button } from '@mui/material';

interface Props {
    text: string;
}

export default function Home(props: Props){
    return(
        <>
            <div className="root">
                <div className="menu">
                    <NavMenu/>
                </div>
                <div className="title">
                    <img src={title}/>
                </div>
                <div className="image">
                    <img src={marela}/>
                </div>
                <div className="about">
                    {props.text}
                </div>
                <div className="links">
                    <Button style={{maxHeight: "30px", maxWidth: "30px", minHeight: "30px", minWidth: "30px"}}>
                        <GitHubIcon style={{maxHeight: "75px", maxWidth: "75px", minHeight: "75px", minWidth: "75px"}}/>
                    </Button>
                    <Button style={{maxHeight: "30px", maxWidth: "30px", minHeight: "30px", minWidth: "30px"}}>
                        <LinkedInIcon style={{maxHeight: "50px", maxWidth: "50px", minHeight: "50px", minWidth: "50px"}}/>
                    </Button>
                    <Button style={{maxHeight: "30px", maxWidth: "30px", minHeight: "30px", minWidth: "30px"}}>
                        <DescriptionIcon style={{maxHeight: "50px", maxWidth: "50px", minHeight: "50px", minWidth: "50px"}}/>
                    </Button>
                </div>
            </div>
        </>
    );
}
